// client/src/GoldExchange.js
import React, { useState } from 'react';

function Sell({ onSell }) {
    const [resourceType, setResourceType] = useState('');
    const [amount, setAmount] = useState(0);
    const handleSell = (resourceType, amount) => {
        onSell(resourceType, amount);
    };

    return (
        <div>
            <h2>Sell your resources</h2>
            <div>
                <label htmlFor="amount">Amount to Wood:</label>
                <input
                    type="number"
                    id="amount"
                    value={amount}
                    onChange={(e) => setAmount(parseInt(e.target.value))}
                />
            </div>
            <button onClick={() => handleSell(resourceType, amount)}>confirm</button>
        </div>
    );
}
export default Sell;
